I interrupt my regularly scheduled holiday programming to bring you Product Sketches. ✍️

For several years, I have had the pleasure of working with talented designers and companies on product development.

These sketches are fully rendered and have many uses. They are used on websites, catalogs, brochures, framed prints, and more. 

I’m currently working on a new line that’s hush, hush. 🤫 

If you need product sketches DM me or contact me through the 🔗 in my bio. 
